import React from "react";
import { Route } from "react-router-dom";
import mechagodzillaList from "../../lists/mechagodzillaList";
import MechagodzillaPath from "./mechagodzillaPathname";

const MechagodzillaRouter = () => {
  for (let i = 0; i < mechagodzillaList.length; i++) {
    return (
      <Route
        path={"/mechagodzilla-list" + mechagodzillaList[i].link}
        component={MechagodzillaPath}
      />
    );
  }
};

export default MechagodzillaRouter;
